import '@babel/polyfill';
import {login, logout} from './login';
import {updateSettings, signupSettings, deleteMe, updateMember, updateMemberEmail}  from './updateSettings';


// dom elements
const signUpForm = document.getElementById('signUpForm');

const loginForm = document.querySelector('.form--login');  
const logoutBtn = document.querySelector('.nav__el--logout');
const dataForm = document.getElementById('accountForm');
const memberForm = document.getElementById('member_update');
const memberUpdate = document.getElementById('member-update');
const memberEmailForm = document.getElementById('memberEmailForm');
const passwordForm = document.querySelector('.form-member-password');
const deleteBtn = document.getElementById('deleteBtn');


// values


if (loginForm) {
    loginForm.addEventListener('submit', e =>{
    e.preventDefault();
    const email = document.getElementById('email').value ;
    const password = document.getElementById('password').value ;
    login(email, password);
  })
}

if (logoutBtn) {
  
  logoutBtn.addEventListener('click', logout);
}

if (dataForm) {
  
  dataForm.addEventListener('submit', e =>{
    e.preventDefault();
    const form = new FormData();
    form.append('firstName', document.getElementById('firstName').value);
    form.append('lastName', document.getElementById('lastName').value);
    form.append('email', document.getElementById('email').value);
    form.append('photo', document.getElementById('photo').files[0]);
    form.append('phone', document.getElementById('phone').value);
    form.append('partner', document.getElementById('partner').value);
    form.append('addressStreet', document.getElementById('addressStreet').value);
    form.append('addressCity', document.getElementById('addressCity').value);
    form.append('addressState', document.getElementById('addressState').value);
    form.append('zipcode', document.getElementById('zipcode').value);

   
    updateSettings(form, 'data');
  })
}

if (passwordForm)
  passwordForm.addEventListener('submit', async e => {
    e.preventDefault();
    document.querySelector('.btn--save-password').textContent = 'Updating...';

    const passwordCurrent = document.getElementById('password-current').value;
    const password = document.getElementById('password').value;
    const passwordConfirm = document.getElementById('password-confirm').value;
    await updateSettings(
      { passwordCurrent, password, passwordConfirm },
      'password'
    );

    document.querySelector('.btn--save-password').textContent = 'Save password';
    document.getElementById('password-current').value = '';
    document.getElementById('password').value = '';
    document.getElementById('password-confirm').value = '';
  });

  if (signUpForm) {
   
   signUpForm.addEventListener('submit', e =>{
    
      e.preventDefault();
      const form = new FormData();
      form.append('firstName', document.getElementById('firstName').value);
      form.append('lastName', document.getElementById('lastName').value);
      form.append('password',document.getElementById('password').value);
      form.append('passwordConfirm',document.getElementById('passwordConfirm').value);
      form.append('email', document.getElementById('email').value);
      form.append('phone', document.getElementById('phone').value);
      form.append('partner', document.getElementById('partner').value);
      form.append('addressStreet', document.getElementById('addressStreet').value);
      form.append('addressCity', document.getElementById('addressCity').value);
      form.append('addressState', document.getElementById('addressState').value);
      form.append('zipcode', document.getElementById('zipcode').value);
      form.append('howdYouHear', document.getElementById('howdYouHear').value);
      form.append('reasonForJoining', document.getElementById('reasonForJoining').value);
      form.append('danceExperience', document.getElementById('danceExperience').value);
    
      signupSettings(form);
    })
  }
  if (deleteBtn) {
    deleteBtn.addEventListener('click', e =>{
      console.log('in delete btn');
      deleteMe();
    });
  }
  if (memberForm) {
   
    memberForm.addEventListener('submit', e =>{
     
       e.preventDefault();
       const form = new FormData();
       form.append('firstName', document.getElementById('firstName').value);
       form.append('lastName', document.getElementById('lastName').value);
       form.append('role',document.getElementById('role').value);
       form.append('email', document.getElementById('email').value);
       form.append('phone', document.getElementById('phone').value);
       form.append('partner', document.getElementById('partner').value);
       form.append('addressStreet', document.getElementById('addressStreet').value);
       form.append('addressCity', document.getElementById('addressCity').value);
       form.append('addressState', document.getElementById('addressState').value);
       form.append('zipcode', document.getElementById('zipcode').value);
       form.append('id', document.getElementById('id').value);
     
       updateMember(form);
     })
   }

   


if (memberEmailForm) {
  memberEmailForm.addEventListener('submit', e =>{
  e.preventDefault();
  const email = document.getElementById('email').value ;

  updateMemberEmail(email);
}) }
